settings.css:
[class*="Voice_voiceStates__"] {
  flex-wrap: wrap;
  display: flex;
  margin: 32px;
  column-gap: 18px;
} 
[class*="Voice_voiceState__"] {
  height: auto;
  margin-bottom: 0;
  display: flex;
  flex-direction: column;
} 
[class*="Voice_avatar__"] {
  border-radius: 8px;
  width: 80px;
  height: 80px;
  margin-bottom: 8px;
  filter: brightness(70%);
  margin-right: 0;
} 
[class*="Voice_avatarSpeaking__"] {
  animation-duration: 750ms;
  position: relative;
  filter: brightness(100%);
  border-color: rgb(255, 237, 190);
  animation: 750ms infinite alternate ease-in-out speak-jump;
  z-index: 1;
} 
[class*="Voice_name__"] {
  left: 0px;
  position: relative;
  max-width: 86px;
  z-index: 2;
  box-sizing: border-box;
  text-overflow: clip;
  white-space: nowrap;
  overflow: hidden;
  display: block;
  text-align: center;
} 
[class*="Voice_user__"] {
  padding-top: 0px;
}
@keyframes speak-jump {
  0% {
    bottom: 0px;
  }
  50% {
    bottom: 10px;
  }
  100% {
    bottom: 0px;
  }
}
@keyframes speak-border {
  0% {
    filter: drop-shadow(2px 2px 0px rgb(255, 236, 189)) drop-shadow(-2px -2px 0px rgb(255, 236, 189)) drop-shadow(-2px 2px 0px rgb(255, 236, 189)) drop-shadow(2px -2px 0px rgb(255, 236, 189));
  }
  50% {
    filter: drop-shadow(2px 2px 0px rgb(255, 236, 189)) drop-shadow(-2px -2px 0px rgb(255, 236, 189)) drop-shadow(-2px 2px 0px rgb(255, 236, 189)) drop-shadow(2px -2px 0px rgb(255, 236, 189));
  }
  100% {
    filter: drop-shadow(2px 2px 0px rgb(255, 236, 189)) drop-shadow(-2px -2px 0px rgb(255, 236, 189)) drop-shadow(-2px 2px 0px rgb(255, 236, 189)) drop-shadow(2px -2px 0px rgb(255, 236, 189));
  }
}
